import React from "react";
import {NavLink} from "react-router-dom";

const MenuLogin = () => {

  return (
    <div className="o-col t-site-header__logo">
      <ul className="c-nav">
      <li><NavLink to="/logowanie" >Zaloguj</NavLink></li>
      <li><NavLink to="/rejestracja" className="c-nav__link">Załóż konto</NavLink></li>
      </ul>
    </div>
  )
}

export default MenuLogin;
